import './css/colors.css'
import './css/style.css'

import Navbar from './navbar'
import Load from './load'
import Container from './container'

import axios from 'axios'

function Home() {
    axios.get(localStorage.getItem('url') + '/about.json')
    .then(function (res) {
        console.log(res.data);
        document.getElementById('content').innerHTML += <Container data={res.data} />
    })
    .catch(function (err) {
        console.log(err)
    });

    return (
        <div className="App">
            <Navbar />
            <div id="content">
                <Load />
                <Container data="Hello World" />
            </div>
        </div>
    );
}

export default Home
